const profile = {
    name: "Felix",
    data: `
        Hello there! I'm Felix and I'm a Fullstack Software Developer. 
        This text does not really matter as of now. Dummy data is the best 
        type of data and mint chip ice-cream is the best ice cream, these are
        just the undeniable rules of the universe. 
    `

}


export default profile;
